import logo from './logo.svg';
import './App.css';
import Nav from './component/nav';
import InputExample from './component/InputExample';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <header className="App-header">
        <Nav />
        <InputExample/>
        <p>Workspace</p>
      </header>
    </div>
    </Router>
  );
}

export default App;
